import React, {Component} from "react";
import "./App.css";

class FailingPage extends Component {
    constructor(prop) {
        super(prop);
        // inheritated from FocusArea: this.props.valueFromParent
        this.state = {
            schedule: [],
        };
    }

    render() {
        return (
            <div>
            <h1
                    style={{
                        display: "flex",
                        justifyContent: "center",
                        alignItems: "center",
                    }}
                >
                    Oops!
                </h1>

            <div class = "title2">
                It seems like that you may not be able to graduate based on courses you have taken.</div>

            <div class = "text4"> Are you sure that you have: </div>
            <div class = "note"> > Entered all your completed courses correctly?</div>
            <div class = "note"> > Entered your current grade/year correctly?</div>

            <div class = "text5"> Still unsure?</div>

            <div>
                    <Link to="/">
                        <button class="button_r" type="button">
                            Go Back
                        </button>
                        <i class="iconfont" style={{position: "absolute", right: "40px"}}>&#xe7f9;</i>
                    </Link>
                </div>

            </div>
        );
    }
}

export default FailingPage;
